import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from 'react-router-dom'
import {provider} from './react-logger'

ReactDOM.render(
  <provider>
  <BrowserRouter>
    <App />
    </BrowserRouter>
    </provider>,
  document.getElementById('root')
);
